import {
  AsideLogo,
  AsideMenuItem,
  DashboardAside,
  LogoText,
  Menu,
} from '../../styles/common/aside.styles';
import DashboardOutlinedIcon from '@mui/icons-material/DashboardOutlined';
import AssignmentIndOutlinedIcon from '@mui/icons-material/AssignmentIndOutlined';
import TopicOutlinedIcon from '@mui/icons-material/TopicOutlined';
import ChecklistOutlinedIcon from '@mui/icons-material/ChecklistOutlined';
import KeyboardArrowRightOutlinedIcon from '@mui/icons-material/KeyboardArrowRightOutlined';
import KeyboardArrowDownOutlinedIcon from '@mui/icons-material/KeyboardArrowDownOutlined';

const DashboardSidebar = () => {
  let target = false;
  let items = [{icon : <DashboardOutlinedIcon />, title:Overview}, 
  {icon : <AssignmentIndOutlinedIcon />, title:Overview},
  {icon : <TopicOutlinedIcon />, title:Overview},
  {icon : <ChecklistOutlinedIcon />, title:Overview}];
  return (
    <DashboardAside>
      <AsideLogo>
        <img src={'/logo.png'} alt="logo" />
        <LogoText>Portfolio For</LogoText>
      </AsideLogo>
      <nav>
        <Menu>
          <li>
            <AsideMenuItem active={target}>
              <DashboardOutlinedIcon />
              <p>Overview</p>
              <KeyboardArrowRightOutlinedIcon />
            </AsideMenuItem>
          </li>
          <li>
            <AsideMenuItem>
              <AssignmentIndOutlinedIcon />
              <p>경력</p>
              <KeyboardArrowRightOutlinedIcon />
            </AsideMenuItem>
          </li>
          <li>
            <AsideMenuItem>
              <TopicOutlinedIcon />
              <p>활동 게시판</p>
              <KeyboardArrowDownOutlinedIcon />
            </AsideMenuItem>
          </li>
          <li>
            <AsideMenuItem>
              <ChecklistOutlinedIcon />
              <p>할일 목록</p>
              <KeyboardArrowRightOutlinedIcon />
            </AsideMenuItem>
          </li>
        </Menu>
      </nav>
    </DashboardAside>
  );
};

export default DashboardSidebar;
